  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes the results of the
  first United States Army Kwajalein Atoll (USAKA) Activities in the Republic of the
  Marshall Islands (UES) inventory of endangered species and wildlife resources at
  USAKA, which was conducted in 1996. The 1996 inventory report is to be used as the
  official record of species and habitats of concern at USAKA until the results of
  the next inventory (1998) are reported and incorporated into the UES pursuant to
  the next applicable annual review. For the National Oceanographic Data Center, interest
  in the report focuses on the marine element. Data tables from marine surveys of
  sponges, corals, and mollusks are given.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
